const Faq = () => {
    return(
        <>
        <div className="bg-white grid grid-cols-1 divide-y mx-5 p-5 rounded-lg">
            <div className="pb-5"><h3>Frequently Asked Questions</h3></div>
            <div className="py-5">
                <div className="grid grid-cols-1 space-y-5">
                    <h2>Question 1</h2>
                    <p>Answer 1</p>
                </div>
            </div>
        </div>
        </>
    )
}

export default Faq;
